import React from 'react';
import BaseLayout from '../../components/layouts/BaseLayout';

const Dashboard: React.FC = () => {
  return (
    <BaseLayout>
      <div>
        <h1>Welcome to the Dashboard</h1>
      </div>
    </BaseLayout>
  );
};

export default Dashboard;
